import React, { Component } from 'react';
import fire from './fire';

class Home extends Component {
    constructor(props) {
        super(props);
        this.logout = this.logout.bind(this);
    }


    logout() {
        fire.auth().signOut();
    }

    render() {
        return (
       <p> Welcome to Home Logout</p>);

    }

}

export default Home;
